    mojo::Message message(base::to_underlying(messages::UDPSocketListener::kOnReceived), kFlags, estimated_payload_size);
    mojo::internal::MessageFragment<::network::mojom::internal::UDPSocketListener_OnReceived_Params_Data> params(message);
    params.Allocate();
