    mojo::internal::MessageFragment<typename decltype(params->src_addr)::BaseType> src_addr_fragment(params.message());
    mojo::internal::Serialize<::network::mojom::IPEndPointDataView>(in_src_addr, src_addr_fragment);
    params->src_addr.Set(src_addr_fragment.is_null() ? nullptr : src_addr_fragment.data());
    mojo::internal::MessageFragment<typename decltype(params->data)::BaseType> data_fragment(params.message());
    mojo::internal::Serialize<::mojo_base::mojom::ReadOnlyBufferDataView>(in_data, data_fragment);
    params->data.Set(data_fragment.is_null() ? nullptr : data_fragment.data());

#if defined(ENABLE_IPC_FUZZER)
    message.set_interface_name(UDPSocketListener::Name_);
    message.set_method_name("OnReceived");
#endif
    // This return value may be ignored as false implies the Connector has
    // encountered an error, which will be visible through other means.
    ::mojo::internal::SendMojoMessage(*receiver_, message);
